import ActionActionTypes from './action.types'

const INITIAL_STATE={
    slip:[ ]
}

const actionReducer = (state=INITIAL_STATE, action)=>{
    switch(action.type){
        case ActionActionTypes.ADD_BET:
        return {
          ...state,slip:state.slip.push(action.payload)

      }
    }

}

export default actionReducer;
